import ReactDOM from "react-dom";
import "./index.css";
import * as serviceWorker from "./serviceWorker";
import "bootstrap/dist/css/bootstrap.css";
import App from "./App";
import SqlCommandForm from "./components/SqlCommandForm";

ReactDOM.render(<SqlCommandForm />, document.getElementById("root"));

